import React, { Component } from "react";

export class Messageboard extends Component {
  constructor() {
    super();
    this.state = {
      installments: 12
    };
  }

  render() {
    return (
      <div>
        <p>data : {this.state.installments}</p>
      </div>
    );
  }
}

export default Messageboard;
